// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./GiBeeToken.sol"; // Importez le contrat BeeToken ERC20

contract ICO {
    GiBeeToken public tokenContract;
    address payable public wallet;
    uint256 public rate;

    event TokensPurchased(address indexed purchaser, address indexed beneficiary, uint256 value, uint256 amount);

    constructor(GiBeeToken _tokenContract, address payable _wallet, uint256 _rate) {
        require(address(_tokenContract) != address(0), "Token contract address cannot be zero");
        require(_wallet != address(0), "Wallet address cannot be zero");
        require(_rate > 0, "Rate must be greater than zero");

        tokenContract = _tokenContract;
        wallet = _wallet;
        rate = _rate;
    }

    function buyTokens(address beneficiary) public payable {
        require(beneficiary != address(0), "Beneficiary address cannot be zero");
        require(msg.value > 0, "Sent ETH value must be greater than zero");

        uint256 tokenAmount = msg.value * rate;
        require(tokenContract.balanceOf(address(this)) >= tokenAmount, "Not enough tokens in the contract");

        tokenContract.transfer(beneficiary, tokenAmount);

        emit TokensPurchased(msg.sender, beneficiary, msg.value, tokenAmount);

        wallet.transfer(msg.value);
    }

    receive() external payable {
        buyTokens(msg.sender);
    }
}
